  };

  return (
    <div className="app-container">

      <Header />

      <main className="main-content">
        <div className="ads">
          <h1>ads</h1>
        </div>
        <div className="containt">
          {display === 'home' && <LoginSignup />}
          {/* {display === 'lesson' && <Lesson showHome={showHome} />} */}
        </div>
        <div className="ads">
          <h1>ads</h1>
        </div>

      </main >

      <Footer />

    </div >
  );
}

export default App;
